import React, { useState, useContext, useEffect } from "react";
import { DataContext } from "../../service/DataContext";
import "./topBar.css";

function TopBar() {
  const { userData, userAuthState, siteDate } = useContext(DataContext);

  return (
    <div className="topbarContainer">
      <div className="left">
        <div className="createdDate">Created: 28-1-2024</div>
        <div className="entries">No. of Entries: 10</div>
        <span>Show:</span>
        <select type="range" name="" id="">
          <option value="10">Latest 10</option>
          <option value="20">Latest 20</option>
          <option value="50">Latest 50</option>
          <option value="all">Show all</option>
        </select>
      </div>
      <div className="right">
        <div className="addStrategy">Add Strategy</div>
        <div className="addTrade">Add Trade</div>
      </div>
    </div>
  );
}

export default TopBar;
